import styled from 'styled-components';


const LoginContainer = styled.div`
  border: 1px solid green;
  width: 50%;
  padding: 4px;
  margin: 3px auto;
  display: flex;
  flex-direction: column;
  justify-content: space-between;



`;





export {LoginContainer};
